INSERT INTO `wp_commentmeta` VALUES (228761, 79535, 'akismet_as_submitted', 'a:53:{s:15:"comment_post_ID";s:5:"17539";s:14:"comment_author";s:9:"mypeweary";s:20:"comment_author_email";s:23:"xvg7s9et6tj@hotmail.com";s:18:"comment_author_url";s:26:"http://www.lookformcm.com/";s:15:"comment_content";s:4745:"巨人・吉村コーチ不可解退団の陰に愛人への不倫暴行事件NEWSポストセブン\r\n\r\n昨シーズン終了とともに、将来の監督候補とも目されていた男が静かに巨人軍を去った。“悲運の天才バッター”吉村禎章（48）。前一軍打撃コーチは、この4月から日本テレビのプロ野球解説者として再スタートを切ることになった。2002年からコーチ陣に加わり二軍監督、一軍野手総合コーチなどを歴任した原辰徳監督の“懐刀”は、なぜ球団を追われることになったのか。そこには火種燻る巨人軍が最も隠したい不祥事があった週刊ポストが取材を続ける中で行き着いたのは都会の喧騒を離れた九州の温泉街だった。ここに名の知られた老舗旅館がある。源泉かけ流し露天風呂、和洋4つのレストラン、日本庭園などを誇る宿には、有名人もお忍びで宿泊している。旅館関係者がいった「吉村さんはたびたびこちらに来ています。家族同伴？いや一人です。ウチの旅館と関係のある女性従業員に会いに来ていたんですよ」\r\n\r\n吉村が九州で会っていたS子さんは40歳前後の目鼻立ちの整った和風美人だ「髪が長くてとても清楚な感じです。芸能人にたとえると東ちづるに似ていますね」（同前）\r\n\r\n2人は、現役引退後の吉村が現地の少年野球教室にコーチとして訪れた際に知り合ったという。再び旅館関係者「周囲は黙認していましたが、数年前から関係がぎくしゃくしてきた。巨人の監督の目も出てきた吉村が、身ぎれいにしておこうと思ったのかはわかりませんが、幾度かS子さんに別れ話を持ちかけていたようです」\r\n\r\n2人の仲違いは徐々にエスカレートしていき、遂に旅館社長の知るところになってしまう。それが2010年のシーズン終了ごろのことだった「社長はS子さんから詳しい事情を聞きました。その席で、S子さんは不倫関係がこじれたばかりか、吉村さんから暴力を振るわれたと訴えた。従業員の窮状を見かねた社長は、球団事務所に“吉村さんの態度はいかがなものか。球団の管理はどうなっているのか”といったクレームを入れたんです」（同前）\r\n\r\n球団が吉村に話を聞くと、旅館社長からの訴えを全て認めた上で、「かみさんにはいえない」と弱り切った様子。さらに「2007年の時（※）に厳重注意したはずだ」との叱責に、「当時から続いていたので、どうにもならなかった」というばかりで、球団幹部もあきれ果てたという。ドロ沼化した両者を見かねた球団が間に入り、不倫清算のための示談交渉が始まった結局、吉村に全面的に落ち度があるとのことで、総額約1500万円を分割で支払うことで解決をみた。取材で得られた情報を巨人番記者にぶつけたところ、吉村退団について合点がいったといい、こう解説した「騒動が2010年の年末に起こっていたのなら、首脳部がすぐに吉村を切れなかったのも当然です。すでにコーチ人事を発表した後に突然の退団となれば、様々な憶測を呼ぶのは必至。おそらく、吉村を信頼していた原監督も相当にかばった結果、どうにか首がつながったのでしょう」\r\n\r\nだが、球団は女性トラブルを繰り返す吉村をこのまま残しておくわけにはいかなかった。昨年の不可解な退団の裏には、この女性スキャンダルがあったのだ※2007年、『FRIDAY』が「巨人、“次期監督最有力候補”吉村『不倫愛人に300万円！』手切れ金の授受現場」というスキャンダルを報じた。 \r\n\r\n<a href=http://www.mcmdeeplove.com/>www.mcmdeeplove.com</a> mcm,mcm リュック,mcm 財布,mcm バッグ,mcm 長財布\r\n\r\n<a href=http://www.coachvipcustomer.com/>www.coachvipcustomer.com</a> コーチ財布,コーチ アウトレット,コーチバッグ,コーチ,COACH\r\n\r\n<a href=http://www.coachsearchjp.com/>コーチ 財布</a> コーチ財布,コーチ アウトレット,コーチバッグ,コーチ,COACH\r\n\r\n<a href=http://www.coachgugou.com/>コーチ バッグ</a> コーチ財布,コーチ アウトレット,コーチバッグ,コーチ,COACH\r\n\r\n<a href=http://www.coachsupplierjp.com/>www.coachsupplierjp.com</a> コーチ財布,コーチ アウトレット,コーチバッグ,コーチ,COACH";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:14:"199.15.234.178";s:10:"user_agent";s:128:"Mozilla/5.0 (Windows; U; Windows NT 6.1; en-US) AppleWebKit/533.4 (KHTML, like Gecko) Iron/5.0.381.0 Chrome/5.0.381 Safari/533.4";s:8:"referrer";s:45:"http://stuyspectator.com/?attachment_id=17539";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:45:"http://stuyspectator.com/?attachment_id=17539";s:21:"akismet_comment_nonce";s:6:"passed";s:11:"POST_author";s:9:"mypeweary";s:10:"POST_email";s:23:"xvg7s9et6tj@hotmail.com";s:8:"POST_url";s:28:"http://www.lookformcm.com/\r\n";s:12:"POST_comment";s:4755:"\r\n巨人・吉村コーチ不可解退団の陰に愛人への不倫暴行事件NEWSポストセブン\r\n\r\n昨シーズン終了とともに、将来の監督候補とも目されていた男が静かに巨人軍を去った。“悲運の天才バッター”吉村禎章（48）。前一軍打撃コーチは、この4月から日本テレビのプロ野球解説者として再スタートを切ることになった。2002年からコーチ陣に加わり二軍監督、一軍野手総合コーチなどを歴任した原辰徳監督の“懐刀”は、なぜ球団を追われることになったのか。そこには火種燻る巨人軍が最も隠したい不祥事があった週刊ポストが取材を続ける中で行き着いたのは都会の喧騒を離れた九州の温泉街だった。ここに名の知られた老舗旅館がある。源泉かけ流し露天風呂、和洋4つのレストラン、日本庭園などを誇る宿には、有名人もお忍びで宿泊している。旅館関係者がいった「吉村さんはたびたびこちらに来ています。家族同伴？いや一人です。ウチの旅館と関係のある女性従業員に会いに来ていたんですよ」\r\n\r\n吉村が九州で会っていたS子さんは40歳前後の目鼻立ちの整った和風美人だ「髪が長くてとても清楚な感じです。芸能人にたとえると東ちづるに似ていますね」（同前）\r\n\r\n2人は、現役引退後の吉村が現地の少年野球教室にコーチとして訪れた際に知り合ったという。再び旅館関係者「周囲は黙認していましたが、数年前から関係がぎくしゃくしてきた。巨人の監督の目も出てきた吉村が、身ぎれいにしておこうと思ったのかはわかりませんが、幾度かS子さんに別れ話を持ちかけていたようです」\r\n\r\n2人の仲違いは徐々にエスカレートしていき、遂に旅館社長の知るところになってしまう。それが2010年のシーズン終了ごろのことだった「社長はS子さんから詳しい事情を聞きました。その席で、S子さんは不倫関係がこじれたばかりか、吉村さんから暴力を振るわれたと訴えた。従業員の窮状を見かねた社長は、球団事務所に“吉村さんの態度はいかがなものか。球団の管理はどうなっているのか”といったクレームを入れたんです」（同前）\r\n\r\n球団が吉村に話を聞くと、旅館社長からの訴えを全て認めた上で、「かみさんにはいえない」と弱り切った様子。さらに「2007年の時（※）に厳重注意したはずだ」との叱責に、「当時から続いていたので、どうにもならなかった」というばかりで、球団幹部もあきれ果てたという。ドロ沼化した両者を見かねた球団が間に入り、不倫清算のための示談交渉が始まった結局、吉村に全