INSERT INTO `wp_commentmeta` VALUES (227218, 79026, 'akismet_as_submitted', 'a:56:{s:15:"comment_post_ID";s:4:"7827";s:14:"comment_author";s:7:"Luciano";s:20:"comment_author_email";s:26:"w.crofriekreac@apache.info";s:18:"comment_author_url";s:54:"http://www.facebook.com/profile.php?id=100003435746209";s:15:"comment_content";s:1428:"Hi Michael,Thanks for stopping by.Just out of cuisiroty, howold is your Vitamix machine?Is it a Vitamix 5200?The warranty I list is for theVitamix 5200.I will copy your response toVitamix and see what theysay.Sorry, if I misled you.  I onlyspelled out what was told tome.             Hi Dave,Thanks for responding.I bought my Vita Mix (a Model 500) from a demonstrator on the boardwalk in Atlantic City in the mid 1960s. He dumped all sorts of vegetables into it then some eggs – in the shells, explaining that the eggs would provide calcium. I tasted the result, and it was good.My not-yet-wife thought that I was nuts to buy what at the time was a fairly expensive product from this smooth talking guy, but she eventually married me anyway.I could certainly buy a new model (Vita Mix, that is – not wife) but I have too much sentiment invested in the original (Vita Mix and wife).I think that it would be to Vita Mix’s advantage to maintain the mystique of Vita Mix by helping folks like me. I don’t expect them to carry parts forever (although that would be nice), but they could be more helpful to us true believers by at least providing helpful information. I have machinist friends who could make the part, but Vita Mix did not respond to a question about how to remove the old part.So you might want to expand your statement from “if at any time” to “if at any time during the 7 year warranty period.”Mike";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:13:"172.20.75.247";s:10:"user_agent";s:55:"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1)";s:8:"referrer";s:76:"http://stuyspectator.com/2011/03/11/steve%e2%80%99s-sub-lime-pies/pies-here/";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:76:"http://stuyspectator.com/2011/03/11/steve%e2%80%99s-sub-lime-pies/pies-here/";s:21:"akismet_comment_nonce";s:6:"passed";s:11:"POST_author";s:7:"Luciano";s:10:"POST_email";s:26:"w.crofriekreac@apache.info";s:8:"POST_url";s:54:"http://www.facebook.com/profile.php?id=100003435746209";s:12:"POST_comment";s:1428:"Hi Michael,Thanks for stopping by.Just out of cuisiroty, howold is your Vitamix machine?Is it a Vitamix 5200?The warranty I list is for theVitamix 5200.I will copy your response toVitamix and see what theysay.Sorry, if I misled you.  I onlyspelled out what was told tome.             Hi Dave,Thanks for responding.I bought my Vita Mix (a Model 500) from a demonstrator on the boardwalk in Atlantic City in the mid 1960s. He dumped all sorts of vegetables into it then some eggs – in the shells, explaining that the eggs would provide calcium. I tasted the result, and it was good.My not-yet-wife thought that I was nuts to buy what at the time was a fairly expensive product from this smooth talking guy, but she eventually married me anyway.I could certainly buy a new model (Vita Mix, that is – not wife) but I have too much sentiment invested in the original (Vita Mix and wife).I think that it would be to Vita Mix’s advantage to maintain the mystique of Vita Mix by helping folks like me. I don’t expect them to carry parts forever (although that would be nice), but they could be more helpful to us true believers by at least providing helpful information. I have machinist friends who could make the part, but Vita Mix did not respond to a question about how to remove the old part.So you might want to expand your statement from “if at any time” to “if at any time during the 7 year warranty period.”Mike";s:11:"POST_submit";s:14:"Submit Comment";s:20:"POST_comment_post_ID";s:4:"7827";s:19:"POST_comment_parent";s:1:"0";s:26:"POST_akismet_comment_nonce";s:10:"dd7be5b92f";s:15:"SERVER_SOFTWARE";s:9:"LiteSpeed";s:11:"REQUEST_URI";s:21:"/wp-comments-post.php";s:11:"HTTP_ACCEPT";s:63:"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:14:"CONTENT_LENGTH";s:4:"1722";s:9:"HTTP_HOST";s:17:"stuyspectator.com";s:12:"HTTP_REFERER";s:76:"http://stuyspectator.com/2011/03/11/steve%e2%80%99s-sub-lime-pies/pies-here/";s:15:"HTTP_USER_AGENT";s:55:"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1)";s:18:"HTTP_CACHE_CONTROL";s:14:"max-age=259200";s:20:"HTTP_X_FORWARDED_FOR";s:13:"172.20.75.247";s:8:"HTTP_VIA";s:44:"1.1 squid-v01.accuweather.com (squid/3.1.10)";s:13:"DOCUMENT_ROOT";s:26:"/home/stuyspec/public_html";s:11:"REMOTE_ADDR";s:13:"172.20.75.247";s:11:"REMOTE_PORT";s:5:"61857";s:11:"SERVER_ADDR";s:14:"199.189.248.96";s:11:"SERVER_NAME";s:17:"stuyspectator.com";s:12:"SERVER_ADMIN";s:27:"webmaster@stuyspectator.com";s:11:"SERVER_PORT";s:2:"80";s:15:"REDIRECT_STATUS";s:3:"200";s:17:"PROXY_REMOTE_ADDR";s:14:"207.242.93.140";s:15:"SCRIPT_FILENAME";s:47:"/home/stuyspec/public_html/wp-comments-post.php";s:12:"QUERY_STRING";s:0:"";s:10:"SCRIPT_URI";s:45:"http://stuyspectator.com/wp-comments-post.php";s:10:"SCRIPT_URL";s:21:"/wp-comments-post.php";s:11:"SCRIPT_NAME";s:21:"/wp-comments-post.php";s:15:"SERVER_PROTOCOL";s:8:"HTTP/1.1";s:14:"REQUEST_METHOD";s:4:"POST";s:8:"PHP_SELF";s:21:"/wp-comments-post.php";s:12:"REQUEST_TIME";s:10:"1370944793";s:4:"argv";s:0:"";s:4:"argc";s:1:"0";s:25:"comment_post_modified_gmt";s:19:"2011-03-12 22:07:33";}'); 
