INSERT INTO `wp_commentmeta` VALUES (228356, 79400, 'akismet_as_submitted', 'a:58:{s:15:"comment_post_ID";s:5:"20682";s:14:"comment_author";s:10:"seo plugin";s:20:"comment_author_email";s:21:"zlhkhoeiaoo@gmail.com";s:18:"comment_author_url";s:26:"http://SEO-SOLUTIONS.INFO/";s:15:"comment_content";s:1312:"Hello Web Admin, I noticed that your On-Page SEO is is missing a few factors, for one you do not use all three H tags in your post, also I notice that you are not using bold or italics properly in your SEO optimization. On-Page SEO means more now than ever since the new Google update: Panda. No longer are backlinks and simply pinging or sending out a RSS feed the key to getting Google PageRank or Alexa Rankings, You now NEED On-Page SEO. So what is good On-Page SEO?First your keyword must appear in the title.Then it must appear in the URL.You have to optimize your keyword and make sure that it has a nice keyword density of 3-5% in your article with relevant LSI (Latent Semantic Indexing). Then you should spread all H1,H2,H3 tags in your article.Your Keyword should appear in your first paragraph and in the last sentence of the page. You should have relevant usage of Bold and italics of your keyword.There should be one internal link to a page on your blog and you should have one image with an alt tag that has your keyword....wait there\'s even more Now what if i told you there was a simple Wordpress plugin that does all the On-Page SEO, and automatically for you? That\'s right AUTOMATICALLY, just watch this 4minute video for more information at. <a href="http://SEO-SOLUTIONS.INFO">Seo Plugin</a>";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:13:"192.95.47.180";s:10:"user_agent";s:154:"Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1) ; .NET CLR 2.0.50727 ; .NET CLR 4.0.30319)";s:8:"referrer";s:57:"http://stuyspectator.com/2013/06/07/unsafe-at-stuyvesant/";s:4